import React from 'react';
import {
  MDBBtn,
  MDBNavbarLink
} from 'mdb-react-ui-kit';
import Header from '../../components/header/header';

const Home = () => {
  return (
    <div>
      <Header />
      <div style={{ padding: 200, display: "flex", flexDirection: "row" }}>
        <div style={{ marginRight: 250}}>
          <h1 style={{ marginBottom: 20 }}>Featured Services</h1>
          <MDBNavbarLink>
            <MDBBtn
              rounded className='mx-2' color='black'
              href='services'
              style={{ fontSize: 15}}
            >
              All Services
            </MDBBtn>
          </MDBNavbarLink>
        </div>

        <div>
          <h3>Service 1 ------------------ +</h3>
          <h3>Service 2 ------------------ +</h3>
          <h3>Service 3 ------------------ +</h3>
          <h3>Service 4 ------------------ +</h3>
        </div>
      </div>

      <img src="/images/Light+Objects+1.jpeg" alt="image1" style={{height:450, width: "100%"}}></img>

      <div class="about-us" style={{ display: "flex", flexDirection: "row", padding:50}}>
        <div>
            <h1>Learn about our business</h1>
        </div>

        <div>
        <img src="/images/callaLilly.jpeg" alt="image1" style={{width: "50%", marginLeft:300}}></img>
        </div>

        <div style={{marginLeft:50, padding: 50}}>
        <img src="/images/Light+Objects+1.jpeg" alt="image1" style={{width: "100%", marginBottom:30}}></img>
        <p>Our small business-owned nail salon is run by three highly skilled nail technicians with years of industry expertise. They specialize in a wide range of nail care services such as SNS, nail art, gel, and so on.</p>
        <p>Their goal is to provide their clients with the best possible service while maintaining the highest standard of sanitization. Explore our gallery to see some of their greatest works over the years, along with those of other incredibly skilled nail technicians.</p>
        </div>
      </div>


      <div>
        <h1 style={{textAlign:"center", padding:80}}>Services we offer</h1>

        <div style={{ display: "flex", flexDirection: "row-reverse", textAlign:"center" }}> 
            <div>
                <img src="/images/3.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Waxing</h3>
            </div>

            <div>
                <img src="/images/2.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Pedicure</h3>
            </div>

            <div>
                <img src="/images/1.png" alt="mani-icon" style={{width: "50%", borderRadius: "50%"}}></img>
                <h3>Manicure</h3>
            </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
